export function indexProductCategoriesRequest(params) {
  return {
    type: "@productCategories/INDEX_PRODUCT_CATEGORIES_REQUEST",
    payload: { params },
  };
}

export function indexProductCategoriesSuccess(body) {
  return {
    type: "@productCategories/INDEX_PRODUCT_CATEGORIES_SUCCESS",
    payload: { body },
  };
}

export function productCategoriesFailure(message, reasons) {
  return {
    type: "@productCategories/PRODUCT_CATEGORIES_FAILURE",
    payload: { message, reasons },
  };
}
